import React from "react";
import "./App.css";
import Postuler from "./components/postuler-aide";
import Accueil from "./components/accueil";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <div>


          {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
          <Switch>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/users">
              <Users />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>

      <Accueil />
      <h1>Dashboard aide</h1>
      <Postuler />
    </div>
  );
}

export default App;
